import React from 'react';
import "../styles/Home.css";
//import bgImage from "../images/sky_background.jpg";

function Home() {
    return (<div className="home">
        <div className="bg">
            <img className="background" src="../images/sky_background.jpg" alt=""/>

        </div>

        <h1 className="title">Cassandra Sziklai</h1>
        <h3 className="welcome">Student interested in the intersection between front-end software development and UX design</h3>

    </div>);
}

export default Home;
